import Plant from './Plant';

function Plants(props) {
    return (
        <div className="plants">
            <Plant name={props[0].name} firstWater={props[0].firstWater} frequency={props[0].frequency} />
            <Plant name={props[1].name} firstWater={props[1].firstWater} frequency={props[1].frequency} />
            <Plant name={props[2].name} firstWater={props[2].firstWater} frequency={props[2].frequency} />
            <Plant name={props[3].name} firstWater={props[3].firstWater} frequency={props[3].frequency} />
        </div>
    )
}
